var title_f24_8_24704="Ca channel sympathetic activity";
var content_f24_8_24704=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F68194&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F68194&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 536px\">",
"   <div class=\"ttl\">",
"    Interaction between sympathetic activation and the calcium channel",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 516px; height: 466px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Acceleration of sinus node automaticity by sympathetic stimulation results from an increase in the influx of sodium (If) during diastolic depolarization and an increase in calcium (Ca++) influx during phase 0; both are due to a direct stimulatory effect of the alpha subunit of the guanosine nucleotide binding protein (G protein) on the respective channels. In the resting nonstimulated state (panel A) guanosine diphosphate is bound to the alpha subunit of the G protein. With beta receptor activation (panel B), guanosine triphosphate (GTP) displaces GDP, stimulating adenyl cyclase; this generates cyclic adenosine monophosphate (cAMP) from adenosine triphosphate (ATP) (panel C). Generation of cAMP activates protein kinase A and phosphorylation of the regulatory component of the CA++ channel; the opening of the Ca++ channel in response to membrane depolarization is increased. Activation of the alpha subunit of the G protein may also activate the Ca++ channel. With deactivation of the beta receptor, an intrinsinc GTPase hydrolyzes GTP to GDP (panel D).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
