var title_f24_8_24709="Lymph nodes head neck PI";
var content_f24_8_24709=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PI%2F55189&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PI%2F55189&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 588px\">",
"   <div class=\"ttl\">",
"    Lymph nodes of the head and neck",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 568px; height: 480px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    This drawing schematically depicts the major lymph nodes in the head and neck area that are likely to be enlarged on physical examination in patients with various local or systemic diseases. The major nodal groups are shown here in bold, with the areas draining into these nodal groups noted when appropriate. While enlargement of both the left and right supraclavicular lymph nodes may reflect disease in the thorax, left supraclavicular nodal enlargement, because of its drainage pattern, may also reflect the presence of abdominal involvement (ie, Virchow's node).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
