var title_f24_8_24711="Postoperative cardiac shift CT";
var content_f24_8_24711=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PULM%2F70082%7EPULM%2F67587%7EPULM%2F81115&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PULM%2F70082%7EPULM%2F67587%7EPULM%2F81115&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Shift in mediastinal position following pneumonectomy",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 360px; height: 240px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Chest CT demonstrates the postoperative change in location of mediastinal organs, with the heart abutting the chest wall. Blind chest tube or needle placement into the postpneumonectomy space may puncture the heart or great vessels.",
"    <div class=\"footnotes\">",
"     LV: left ventricle, RV: right ventricle, LA: left artium, RA: right artium, a: descending aorta, e: esophagus.",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Richard Irwin, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Postpneumonectomy shift of the liver",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 360px; height: 238px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    <p>",
"     Chest CT demonstrates the postoperative change in location of the liver, showing the potential risk of hepatic injury with blind chest tube or needle placement into the postpneumonectomy space. The liver (closed arrow) abuts the chest wall; the open arrow denotes fluid in the postpneumonectomy space.",
"    </p>",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Richard Irwin, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Postpneumonectomy shift of the spleen",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 360px; height: 231px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Chest CT scan demonstrates the postoperative change in location of the spleen (arrow) and illustrates the potential risk of splenic injury with blind chest tube or needle placement into the postpneumonectomy space.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Richard Irwin, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
