"   <a href=\"?imageKey=PC%2F74010%7EDERM%2F50781%7EDERM%2F63574%7EDERM%2F76411&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PC%2F74010%7EDERM%2F50781%7EDERM%2F63574%7EDERM%2F76411&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
