var title_f24_8_24715="Changes venous hypertension";
var content_f24_8_24715=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PC%2F80827&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=7\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PC%2F80827&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=7\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Anatomical, histological, and physiological changes associated with venous hypertension",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Category",
"       </td>",
"       <td class=\"subtitle1\">",
"        Primary abnormality",
"       </td>",
"       <td class=\"subtitle1\">",
"        Consequences",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Anatomical",
"       </td>",
"       <td>",
"        Valvular incompetence",
"       </td>",
"       <td>",
"        Retrograde transmission of pressure and volume into the superficial venous system, increased venous hypertension producing further valvular incompetence",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Histological",
"       </td>",
"       <td>",
"        Elongation and dilation of capillary beds, increased capillary surface area, increased basement membrane type IV collagen, formation of pericapillary fibrin cuff, fragmentation and obliteration of cutaneous microlymphatics",
"       </td>",
"       <td>",
"        Increased interstitial accumulation of vascular water, red blood cells, fibrin, tissue hypoxia, and formation of a subcutaneous panniculitis (lipodermatosclerosis)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Physiological",
"       </td>",
"       <td>",
"        Loss of reflexive constriction of precapillary arterioles, erythrocyte and leukocyte aggregation",
"       </td>",
"       <td>",
"        Increased capillary hydrostatic pressure, reduced oxygen transport, slowed arteriolar circulation, enlarged capillary spaces, leukocyte aggregation and activation, and formation of a subcutaneous panniculitis (lipodermatosclerosis)",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
